import React from 'react';

const LivresDetailsPage = () => {
    return (
        <div class="livres-details">
            <div class="details">
                <img src='https://www.google.com/url?sa=i&url=https%3A%2F%2Ffr.postermywall.com%2Findex.php%2Fart%2Ftemplate%2Fca3f4b3e36c7921b98f0263db7d757ba%2Fkindle-book-cover-business-book-cover-design-template&psig=AOvVaw2JrQoYUdBi4YUYIYg0Nt-c&ust=1741648706278000&source=images&cd=vfe&opi=89978449&ved=0CBQQjRxqFwoTCPiU75eR_osDFQAAAAAdAAAAABAE' />
            </div>
            <div class="main">
                <h1>TITRE</h1>
            </div>
        </div>
    );
};

export default LivresDetailsPage;
